json.viewLogic:
view: book {
  sql_table_name: public.book ;;

  dimension: name {
    type: string
    sql: ${TABLE}."name" ;;
  }

  measure: count {
    type: count
    drill_fields: [name]
  }
}

view: +book {
  dimension: date {
    type: string
    sql: ${TABLE}."date" ;;
  }
}

include: "book.view"

view: +book {
  dimension: issue_date_3 {
    type: number
    sql: ${TABLE}."date" ;;
  }
}


view: extend_book {
  extends: [book]
}

view: order {
  sql_table_name: public.order ;;

  dimension: order_id {
    type: number
    sql: ${TABLE}."order_id" ;;
  }

  dimension: book_id {
    type: number
    sql: ${TABLE}."book_id" ;;
  }

}

include: "book.view"

view: issue_history {
  sql_table_name: public.issue_history ;;

  dimension: book_name {
    type: string
    sql: ${TABLE}."book_name" ;;
  }

  dimension: user_name {
    type: string
    sql: ${TABLE}."user_name" ;;
  }

  measure: count {
    type: count
    drill_fields: [book_name, user_name]
  }
}


view: +book {
  dimension: issue_date_2 {
    type: string
    sql: ${TABLE}."date" ;;
  }
}

view: +book {
  dimension: issue_date_4 {
    type: string
    sql: ${TABLE}."date" ;;
  }
}
